import { BarChart, Bar, XAxis, YAxis } from 'recharts';

export default function OrderBookChart () {

    const fakeData = [
                        {asking_price: 100, shares: 50},
                        {asking_price: 200, shares: 5} 
                    ]; 
    console.log(fakeData)
    return (
        <div> 
            <h6>order book chart </h6>
            {/* <BarChart width={600} height={400} data={fakeData}> */}
            <BarChart width={600} data={fakeData}>
                <XAxis />
                <YAxis />
                <Bar 
                    datakey="asking_price" 
                    barSize={30} 
                    fill="#8884d8"
                />
            </BarChart>
        </div>
    )
}
